import './style/App.css';
import './style/buisnessCard.css';
import './style/dropDown.css';
import "./components/buisnessCard"
import BuissnessCard from './components/buisnessCard';
import DropDown from './components/dropdown';
import {useState} from "react";


function App() {

  const [hidePhone, setHidePhone] = useState("hide");
  const [hidePhoneSpace, setHidePhoneSpace] = useState("hidePhoneSpace");

  const [hideSoc, setHideSoc] = useState("hide");
  const [socBox, setSocBox] = useState("hideSocBox");
  const [atDrop, setAtDrop] = useState("hideAtDrop")
  const [socSpace, setSocSpace] = useState("hideSocSpace");



  const [turn, setTurn] = useState("");

  return (
    <div className="App">
      <BuissnessCard 
        turn={turn}
        setTurn={setTurn}
        setHidePhone={setHidePhone}
        setHidePhoneSpace={setHidePhoneSpace}
        setHideSoc={setHideSoc}
        setSocBox={setSocBox}
        setSocSpace={setSocSpace}
        setAtDrop={setAtDrop}
        />
      <DropDown
        turn={turn}
        hidePhoneSpace={hidePhoneSpace}
        hidePhone={hidePhone}
        hideSoc={hideSoc}
        socBox={socBox}
        socSpace={socSpace}
        atDrop={atDrop}
      />
      </div>
  );
}

export default App;
